%[text] %[text:anchor:T_361C3B95] # Building Energy Management System with Simscape
%[text] 
%[text] Copyright 2024 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] ## Project Overview
%[text] This project contains Simscapeâ„¢ Custom Libraries and Utilities that can help you create large buildings and analyze the thermal comfort. The project also contains utilities that help you build and analyze a data center from a thermal management perspective.
%[text] ![](text:image:1781)
%[text] Open the Simulink Library Browser to familiarize yourself with the Custom Libraries provided with this project. To view the custom libraries, at the MATLAB Command prompt, enter:
%[text] ```matlabCodeExample
%[text] openCustomLib
%[text] ```
%[text] This project automates your building creation, model development, and the setup of a system model for analysis.
%[text] ![](text:image:9792)
%[text] %[text:anchor:M_5dba] ## Create Building Definition
%[text] There are two different ways to create a building geometry definition in Simscape.
%[text] - **Recommended Workflow**: Use MATLAB utilities to create a building definition quickly, and save the building definition as a XML part file (see [Create Building Model Part Using Utilities](matlab:openFileInProject("CreateBuildingModelPart"))).
%[text] - Import a Building Information Model, BIM, from other tools, like Revit, and specify your building definition (see [Create Building Model Part From BIM Import](matlab:openFileInProject("CreateBuildingModelPartFromBIM"))).  \
%[text] %[text:anchor:TMP_453f] Once you have created a building definition and saved it as a XML, you can share it or use it for analysis. To learn more about the building model description, see [Building Definition in Simscape](matlab:web("DocumentationBuildingDefinitionSimscape.html")).
%[text] ## Create Building Library
%[text] The next step is to create a custom Simscape library based representation of the building from it's part file definition. See [Create Building Simscape Library from XML Part](matlab:openFileInProject("CreateBuildingSimscapeLibrary")) and learn how to create a Simscape model of the building, starting from it's part file definition. For each part definition, you can create two different library fidelity - **Thermal** and **Thermal Liquid (TL)** variants.
%[text] ![](text:image:5352)
%[text] You can alternatively choose to create the building library manually and skip the steps in [`Create Building Definition`](internal:M_5dba). As an example, see [Create Detailed House Using Custom Library Components](matlab:openFileInProject("CreateBuildingUsingCustomLibraryBlocks")) to learn how to use Simscape Custom Library blocks and create a detailed house with spatial temperature variation inside the room. This method does not utilize automated scripts.
%[text] ## Create Analysis Template
%[text] See [Create Building Simscape System Model](matlab:openFileInProject("CreateBuildingSimscapeSystemModel")) to setup a system model for building analysis. The system model is not a complete model, but serves as a starting point for manually creating a model based on your requirements.
%[text] ## Engineering Analysis
%[text] ### Building HVAC Requirement Analysis
%[text] See [Estimate Building HVAC Requirements](matlab:openFileInProject("EstimateRequirementsBuildingHVAC")) to learn how to use the building created in the steps above and estimate heat pump sizing for thermal comfort.
%[text] ![](text:image:9f1b)
%[text] ### Data Center HVAC Requirement Analysis
%[text] See [Create Data Center Model for HVAC Load Analysis](matlab:openFileInProject("CreateDatacenterForUtilizationAnalysis")) to learn how to estimate HVAC requirements for a typical data center. This is a stand-alone analysis and uses components from the building model, but is not dependent on the above steps.
%[text] ![](text:image:7e72)
